import { Link } from 'react-router-dom'

export const Nav = ()=>{
    return (
        <div>
         <Link to='/home'> <button>Home</button> </Link>
         <Link to='/create_videogames'> <button>Create Activities</button> </Link>

        </div>
    )
}
